import React from "react";
import "./slidebar.css";

import OwlCarousel from "react-owl-carousel";
import "../../../node_modules/owl.carousel/dist/assets/owl.carousel.min.css";
import "../../../node_modules/owl.carousel/dist/assets/owl.theme.default.min.css";

import phoneImage from "../../assests/pexels-photo-214487.jpeg";
import watchImage from "../../assests/pexels-photo-437037.webp";
import laptopImage from "../../assests/pexels-photo-8774466.webp";

const Slidebar = () => {
  return (
    <div className="slider">
      <OwlCarousel className="owl-theme" items={3} autoplay nav dots loop>
        {/* phoneImage */}
        <div className="phoneSlider">
          <div className="phoneSliderInfo"></div>
        </div>

        {/* watchImage */}
        <div className="watchSlider">
          <div className="watchSliderInfo">
            <h2> Apple</h2>
            <h1>Smart Watch Series 2</h1>
            <h2>Discount up to 45%*</h2>
          </div>
        </div>

        {/* laptopImage */}
        <div className="laptopSlider">
          <div className="laptopSliderInfo">
            <h2>SAMSUNG</h2>
            <h1>Galaxy Note 20</h1>
            <h2>Discount up to 45%*</h2>
          </div>
        </div>
      </OwlCarousel>
    </div>
  );
};

export default Slidebar;
